var tipuesearch = {"pages":[{"title":"O","text":"Nacházíte se na webových stránkách jednoho šíleného učitele z VOŠ a SPŠE Olomouc . Tyto stránky jsou určeny pro podporu mojí výuky. Každé téma, které aktuálně vyučuji, tady má svou stránku. Některé stránky podávají souhrnné informace, některé jsou jen sbírkou odkazů na jiná místa na internetu. Pokud vám tu něco chybí, napište mi. Pokud najdete chybu, napište mi. Motto Nikdo nevěděl, odkud přišli, ale najednou byli v Lese: Klokanice a Klokánek. Když se Pú zeptal Kryštůfka Robina: „Jak se sem dostali?\", Kryštůfek Robin řekl: „Obvyklým způsobem, jestli víš, jak to myslím, Pú,\" a Pú, který to nevěděl, řekl: „Aha!\" Pak dvakrát kývl hlavou a řekl: „Obvyklým způsobem. Ach tak!\" Marek Nožka","tags":"pages","url":"https://chytrosti.marrek.cz/pages/o.html","loc":"https://chytrosti.marrek.cz/pages/o.html"},{"title":"MIT","text":"Nástroje, kity, prostředí Pro výuku mikroprocesorové techniky používáme vývojovou desku Nucleo- 8S208RB s mikroprocesorem STM8S208RB . Jako vývojové prostředí používáme STVD s komipilátorem Cosmic . Oba nástroje je možné bezplatně používat, když se zaregistrujete. Bohužel nejsou ani jeden OpenSource . Céčko Programuje v jazyce C .","tags":"MITka","url":"https://chytrosti.marrek.cz/mit.html","loc":"https://chytrosti.marrek.cz/mit.html"},{"title":"PRG","text":"Jak na to? jednoduše :-)","tags":"Programování","url":"https://chytrosti.marrek.cz/prg.html","loc":"https://chytrosti.marrek.cz/prg.html"},{"title":"PSK","text":"kokodák lalal","tags":"PSKáčko","url":"https://chytrosti.marrek.cz/psk.html","loc":"https://chytrosti.marrek.cz/psk.html"},{"title":"SIT","text":"Tot","tags":"SÍTě","url":"https://chytrosti.marrek.cz/sit.html","loc":"https://chytrosti.marrek.cz/sit.html"}]};